  true,\n\t\"url\": null,\n\t\"notes\": \"The EIA's annual energy outlook (AEO) contains
  yearly projections for a variety of energy-related statistics, for several forecast
  cases. According to EIA, \"under the assumption that current laws and regulations
  remain unchanged throughout the projections, the AEO2011_ Reference case provides
  the basis for examination and discussion of energy production, consumption, technology,
  and market trends and the direction they may take in the future.\" Included here
  are all tables from the report, in the following formats: CSV, XML, RDF.\",\n\t\"license_title\":
